import React, { useEffect, useState } from "react";
import ForceGraph2D from "react-force-graph-2d";

// Mappa colori RGB
const coloriRGB = {
  A: "rgb(229,166,250)",
  B: "rgb(50,115,213)",
  C: "rgb(142,68,24)",
  D: "rgb(140,26,17)",
  E: "rgb(106,23,245)",
  F: "rgb(38,91,53)",
  G: "rgb(101,203,91)",
  H: "rgb(247,206,160)",
  I: "rgb(69,8,88)",
  J: "rgb(174,252,187)",
  K: "rgb(140,125,38)",
  L: "rgb(167,203,63)",
  M: "rgb(178,36,133)",
  N: "rgb(18,50,123)",
};

function AnalyticsPage() {
  const [graphData, setGraphData] = useState({ nodes: [], links: [] });
  const [loading, setLoading] = useState(false);

  // Filtri
  const [rete, setRete] = useState("BONF");
  const [eta, setEta] = useState("30-40");
  const [rangeAnni, setRangeAnni] = useState("2000-2010");
  const [sesso, setSesso] = useState("M");

  const fetchGraph = async () => {
    setLoading(true);
    try {
      const queryParams = new URLSearchParams({
        rete,
        eta,
        range_anni: rangeAnni,
        sesso,
      });

      const res = await fetch(`http://localhost:8000/graph?${queryParams}`);
      const data = await res.json();

      const coloredNodes = data.nodes.map((node) => {
        const firstChar = node.id.charAt(0);
        return {
          ...node,
          color: coloriRGB[firstChar] || "gray",
        };
      });

      setGraphData({ nodes: coloredNodes, links: data.edges });
    } catch (err) {
      console.error("Errore nel caricamento del grafo:", err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchGraph();
  }, [rete, eta, rangeAnni, sesso]);

  return (
    <div style={{ padding: "20px" }}>
      <h2>Visualizzazione grafo ICD</h2>

      {/* Filtri */}
      <div style={{ marginBottom: "10px" }}>
        <label>
          Rete:
          <select value={rete} onChange={(e) => setRete(e.target.value)}>
            <option value="BOFN">BONF</option>
            <option value="FDR">FDR</option>
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Età:
          <select value={eta} onChange={(e) => setEta(e.target.value)}>
            <option value="0-10">0-10</option>
            <option value="10-20">10-20</option>
            <option value="20-30">20-30</option>
            <option value="30-40">30-40</option>
            <option value="40-50">40-50</option>
            <option value="50-60">50-60</option>
            <option value="60-70">60-70</option>
            <option value="70-80">70-80</option>
            <option value="80-90">80-90</option>
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Range anni:
          <select value={rangeAnni} onChange={(e) => setRangeAnni(Number(e.target.value))}>
            <option value={0}>2003–2004</option>
            <option value={1}>2005–2006</option>
            <option value={2}>2007–2008</option>
            <option value={3}>2009–2010</option>
            <option value={4}>2011–2012</option>
            <option value={5}>2013–2014</option>
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Sesso:
          <select value={sesso} onChange={(e) => setSesso(e.target.value)}>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
        </label>
      </div>

      {/* Grafico */}
      <div style={{ height: "85vh", border: "1px solid #ccc" }}>
        {loading ? (
          <p>Caricamento grafo...</p>
        ) : (
          <ForceGraph2D
            graphData={graphData}
            nodeId="id"
            nodeLabel="id"
            nodeAutoColorBy={null}
            nodeColor={(node) => node.color}
            linkSource="source"
            linkTarget="target"
            backgroundColor="#ffffff"
            cooldownTicks={0}
            enableNodeDrag={false}
            nodeCanvasObjectMode={() => "after"}
            nodeCanvasObject={(node, ctx, globalScale) => {
              const label = node.id;
              const fontSize = 12 / globalScale;
              ctx.font = `${fontSize}px Sans-Serif`;
              ctx.fillStyle = node.color || "gray";
              ctx.textAlign = "center";
              ctx.textBaseline = "middle";
              ctx.fillText(label, node.x, node.y + 10);
            }}
          />
        )}
      </div>
    </div>
  );
}

export default AnalyticsPage;
